import React, { ChangeEventHandler,  } from "react";
import Header from "../components/Header";
import RegistrationForm from "../components/RegistrationForm";
import EmployeeCard from "../components/EmployeeCard";

type MyProps = {
  onChange : ChangeEventHandler<HTMLInputElement>,
  handleClick: any,
  employeesList: {}[],
 };

class Employees extends React.Component<MyProps>{
    render(): React.ReactNode {
      const { onChange, handleClick, employeesList } = this.props
        return(
            <div>
              <Header 
                linkTo="/cargos" 
                linkTitle="Cargos" 
                headerTitle="Cadastramento de funcionários" 
              />

              <RegistrationForm handleClick={ handleClick } onChange={onChange} />

              <div className="row row-cols-1 row-cols-md-4 g-4 mt-5 px-5">

                <EmployeeCard 
                    name="Pedro Victor" 
                    position="FrontEnd React Jr"
                    birthDate="28/04/2004"
                    salary="R$2014,00"
                    positionDesc="Atua na área de design da aplicação web"
                />
              </div>

            </div>
        );
    }
}

export default Employees;
